import{_ as e,e as t}from"./app.480fbf29.js";const n={},o=t('<h1 id="requirements" tabindex="-1"><a class="header-anchor" href="#requirements" aria-hidden="true">#</a> Requirements</h1><p>To use these starter dashboards, you need:</p><ul><li><p><strong>IBM IMS Connect Extensions for z/OS v3.1</strong></p><p>The starter dashboards use JSON Lines data from IMS Connect Extensions feed job.</p><p>You must have configured IMS Connect Extensions data feed to forward data to Splunk.</p><p>IMS Connect Extensions introduced several new features in several PTFs. The following table shows the required APARs for each feature:</p><table><thead><tr><th>Applications</th><th>Required APAR level</th><th>Note</th></tr></thead><tbody><tr><td>IMS Connect transaction analysis</td><td>-</td><td>z/OS Connect token: PH55459</td></tr><tr><td>IMS Connect Open Database analysis</td><td>PH56965</td><td>z/OS Connect token: PH55459</td></tr></tbody></table></li><li><p><strong>Splunk</strong></p><p>The starter dashboards and related Splunk artifacts were developed and tested in Splunk <strong>8.2</strong>. For compatibility with other versions of Splunk, see the Splunk documentation.</p><div class="custom-container tip"><p class="custom-container-title">NOTE</p><p>Depending on the transaction rate of your IMS Connect systems and the number of fields you choose to forward, the IMS Connect Extensions feed can generate a high volume of data. As with any data that you index in Splunk, you must monitor and manage your indexing volume.</p></div></li></ul><h2 id="screen-resolution" tabindex="-1"><a class="header-anchor" href="#screen-resolution" aria-hidden="true">#</a> Screen resolution</h2><p>The dashboards were developed on a screen with a resolution of 1920 \u2715 1080 pixels.</p><p>At lower resolutions, some dashboards might exhibit rendering issues.</p><h2 id="what-you-need-to-know" tabindex="-1"><a class="header-anchor" href="#what-you-need-to-know" aria-hidden="true">#</a> What you need to know</h2><p>To install the starter dashboards, you need to know how to configure Splunk.</p><p>To forward data to the starter dashboards, you need to know how to configure IMS Connect Extensions.</p><p>To use the starter dashboards, you need to know how to use Splunk, and you need to understand the data shown in the dashboards.</p>',10);function a(s,r){return o}var i=e(n,[["render",a]]);export{i as default};
